#Application configuration
server.port=0

#RabbitMQ configuration
spring.rabbitmq.host=localhost
spring.rabbitmq.port=5672
spring.rabbitmq.username={cipher}
spring.rabbitmq.password={cipher}

#Eureka configuration
eureka.login={cipher}
eureka.password={cipher}
eureka.url=localhost
eureka.port=8761
eureka.client.service-url.defaultZone=http://${eureka.login}:${eureka.password}@{eureka.url}:{eureka.port}/eureka